import React, { Component } from 'react'
import logo from './gclogo.png'
import './header.scss'

export default class Header extends Component {
  constructor(props){
    super(props);
    this.state={
      value:""
    }
  }
  render() {
    return (
      <div className="navbar">
        <img src={logo} alt="" height="100px" width="100px"></img>
        <input value={this.state.value} placeholder="Search.." onChange={this.props.changeText(this.state.value) }type="text"></input>
      </div>

    )
  }
}
